goog.provide('promethean.mcp.dev_ui.core');
promethean.mcp.dev_ui.core.styles = ":root {
  color-scheme: dark;
  font-family: "Inter", "Segoe UI", sans-serif;
  background: #0f172a;
}

body {
  margin: 0;
  padding: 0;
  background: linear-gradient(160deg, #0f172a 0%, #1e293b 100%);
  color: #e2e8f0;
  min-height: 100vh;
}

h1, h2, h3 {
  margin: 0;
}

button {
  cursor: pointer;
}

.app {
  max-width: 1200px;
  margin: 0 auto;
  padding: 32px 24px 48px;
  display: flex;
  flex-direction: column;
  gap: 24px;
}

.app__header {
  display: flex;
  flex-direction: column;
  gap: 12px;
}

.app__title {
  font-size: 2.25rem;
  font-weight: 700;
}

.app__subtitle {
  color: #94a3b8;
}

.panels {
  display: grid;
  grid-template-columns: repeat(auto-fit, minmax(320px, 1fr));
  gap: 24px;
}

.panel {
  background: rgba(15, 23, 42, 0.72);
  border: 1px solid rgba(148, 163, 184, 0.2);
  border-radius: 16px;
  padding: 24px;
  display: flex;
  flex-direction: column;
  gap: 16px;
  backdrop-filter: blur(12px);
  box-shadow: 0 18px 45px rgba(15, 23, 42, 0.4);
}

.panel__title {
  font-size: 1.25rem;
  font-weight: 600;
}

.chat-log {
  display: flex;
  flex-direction: column;
  gap: 12px;
  max-height: 320px;
  overflow-y: auto;
  padding-right: 8px;
}

.chat-message {
  padding: 12px 16px;
  border-radius: 12px;
  line-height: 1.5;
  background: rgba(30, 64, 175, 0.2);
  border: 1px solid rgba(59, 130, 246, 0.4);
}

.chat-message--user {
  align-self: flex-end;
  background: rgba(59, 130, 246, 0.3);
}

.chat-message__author {
  font-size: 0.75rem;
  text-transform: uppercase;
  letter-spacing: 0.08em;
  color: #60a5fa;
  margin-bottom: 4px;
}

.chat-inputs {
  display: flex;
  gap: 12px;
}

.chat-inputs textarea {
  flex: 1;
  resize: vertical;
  min-height: 60px;
  max-height: 160px;
  border-radius: 12px;
  border: 1px solid rgba(148, 163, 184, 0.2);
  background: rgba(15, 23, 42, 0.8);
  color: inherit;
  padding: 12px 16px;
  font-size: 1rem;
}

.primary-button {
  background: linear-gradient(135deg, #2563eb 0%, #7c3aed 100%);
  border: none;
  border-radius: 12px;
  padding: 12px 20px;
  color: white;
  font-size: 1rem;
  font-weight: 600;
  transition: transform 120ms ease, box-shadow 120ms ease;
}

.primary-button:hover {
  transform: translateY(-1px);
  box-shadow: 0 12px 24px rgba(59, 130, 246, 0.25);
}

.secondary-button {
  border-radius: 12px;
  border: 1px solid rgba(148, 163, 184, 0.4);
  background: rgba(15, 23, 42, 0.6);
  color: #dbeafe;
  padding: 10px 16px;
  font-size: 0.95rem;
}

.text-input,
.select-input {
  border-radius: 12px;
  border: 1px solid rgba(148, 163, 184, 0.2);
  background: rgba(15, 23, 42, 0.8);
  color: inherit;
  padding: 10px 14px;
  font-size: 0.95rem;
  width: 100%;
  box-sizing: border-box;
}

.tool-list,
.endpoint-list,
.proxy-list,
.resolved-list {
  display: flex;
  flex-direction: column;
  gap: 12px;
  max-height: 320px;
  overflow-y: auto;
  padding-right: 8px;
}

.tool-card,
.endpoint-row,
.proxy-card,
.resolved-card {
  border-radius: 12px;
  border: 1px solid rgba(148, 163, 184, 0.2);
  padding: 16px;
  background: rgba(15, 23, 42, 0.6);
  display: flex;
  flex-direction: column;
  gap: 8px;
}

.tool-card__header {
  display: flex;
  justify-content: space-between;
  align-items: center;
}

.tool-card__id {
  font-weight: 600;
  color: #f8fafc;
}

.tool-card__description {
  color: #cbd5f5;
  line-height: 1.4;
}

.endpoint-row__header {
  display: flex;
  gap: 12px;
  align-items: center;
}

.endpoint-tools,
.global-tools {
  display: flex;
  flex-wrap: wrap;
  gap: 8px;
}

.tool-chip {
  display: flex;
  align-items: center;
  gap: 6px;
  padding: 6px 10px;
  border-radius: 999px;
  background: rgba(37, 99, 235, 0.16);
  border: 1px solid rgba(96, 165, 250, 0.3);
  font-size: 0.85rem;
}

.status-banner {
  min-height: 20px;
  border-radius: 12px;
  padding: 12px 16px;
  font-weight: 600;
  background: rgba(22, 163, 74, 0.18);
  border: 1px solid rgba(34, 197, 94, 0.35);
  color: #bbf7d0;
}

.status-banner--error {
  background: rgba(220, 38, 38, 0.16);
  border-color: rgba(248, 113, 113, 0.35);
  color: #fecaca;
}

.error-banner {
  background: rgba(220, 38, 38, 0.16);
  border: 1px solid rgba(248, 113, 113, 0.35);
  border-radius: 12px;
  padding: 12px 16px;
  color: #fecaca;
}

.footer-actions {
  display: flex;
  gap: 12px;
  flex-wrap: wrap;
}

.loading-overlay {
  display: flex;
  align-items: center;
  justify-content: center;
  gap: 12px;
  padding: 12px 16px;
  border-radius: 12px;
  border: 1px solid rgba(148, 163, 184, 0.25);
  background: rgba(15, 23, 42, 0.75);
}

.loading-dot {
  width: 10px;
  height: 10px;
  border-radius: 999px;
  background: #60a5fa;
  animation: bounce 1.2s infinite ease-in-out;
}

.loading-dot:nth-child(2) {
  animation-delay: 0.15s;
}

.loading-dot:nth-child(3) {
  animation-delay: 0.3s;
}

@keyframes bounce {
  0%, 80%, 100% {
    transform: scale(0.6);
    opacity: 0.6;
  }
  40% {
    transform: scale(1.0);
    opacity: 1;
  }
}
